define('widgets/wemo_coffeemaker/js/model',['Cache', 'text!widgets/wemo_coffeemaker/rulesTemplate/defaultRules.json'],
    /** @exports model class and instantiated model */
    function(Backbone, defaultRulesTemplate) {

        'use strict';

        var mockPath = 'widgets/wemo_coffeemaker/mocks/',
            jsonDefaultTemplate = JSON.parse(defaultRulesTemplate);

        var Model = Backbone.WemoDeviceModel.extend({
            /**
             * default data values
             */
            defaults: {
                'mode': 3,
                'modeTime': 0,
                'timeRemaining': 0,
                'waterLevelReached': 0,
                'cleanAdvise': 0,
                'filterAdvise': 0,
                'brewing': 0,
                'brewed': 1403174880,
                'cleaning': 0,
                'lastCleaned': 0,
                'filterNotification': 0,
                'scheduleEnable': 1,
                'save': 1,
                'nextSchedule': 7,
                'selectedDays': [],
                'selectedTime': '',
                'flag': 0,
                'defaultTime': '5:28am',
                'daySelected': 0,
                'modeClone': 3,
                'rulesPresent': 0,
                'tapped': 0,
                'setDefault': 0,
                'defaultFriendlyName': '',
                "defaultIcon": "file:///android_asset/www/img/new_icons/HolmesBionaire_AirPurifier_@3x.png"

            },
            /**
             * validation fields, uses Backbone.validation
             */
            validation: {
                'mode': {
                    required: true
                },
                'modeTime': {
                    required: true
                },
                'timeRemaining': {
                    required: true
                },
                'waterLevelReached': {
                    required: true
                },
                'cleanAdvise': {
                    required: true
                },
                'filterAdvise': {
                    required: true
                },
                'brewing': {
                    required: true
                },
                'brewed': {
                    required: true
                },
                'cleaning': {
                    required: true
                },
                'lastCleaned': {
                    required: true
                }
            },
            /** Executes the setAttribute native command**/
            saveAction: function(variable) {
                return this.save(variable);
            },
            /**
             * set the native set command( To be review by Michael)
             */
            setCommand: 'SetAttributes',
            /**
             *  set the native get command (To be review by Michael)
             */
            getCommand: 'GetAttributes',
            /**
             * Default rules templates
             */
            getDefaultRules: jsonDefaultTemplate,
            /**
             /**
             * attributes that are sent/received from cloud
             * @type {Array}
             */
            cloudAttributeList: [],
            /**
             * runs once when the model is instantiated
             */
            initialize: function() {

            },
            /**
             * parses the response when remote call is made, for instances like when remote returns status, but it is actually equivalent to mode
             * @param resp {JSON}
             * @returns {JSON}
             */
            mapToLocal: function(resp) {
                if (resp.attributeLists) {
                    $.each(resp.attributeLists.attribute, function(key, val) {
                        resp[val.name] = val.value;
                    });
                }
                return resp;
            },
            /**
             * Function to add the days for the next brew in an array
             * @param dayNumber
             * @param dayTime
             */
            addNextBrew: function(dayNumber, dayTime) {
                if (this.get('selectedDays').length === 0) {
                    this.get('selectedDays').push(dayNumber);

                    this.set('nextSchedule', dayNumber);
                    this.set('selectedTime', dayTime);
                } else if (this.get('selectedDays').indexOf(dayNumber) === -1) {
                    this.get('selectedDays').push(dayNumber);
                } else {
                    var dayPosition = this.get('selectedDays').indexOf(dayNumber);
                    this.get('selectedDays').splice(dayPosition, 1);
                    this.get('selectedDays').push(dayNumber);
                }
                this.saveToCache();
            },
            /**
             * urls, statusUrl, and rulesUrl all allow dummy data to be loaded for demo/test
             * @returns {string}
             */
            url: function() {
                return mockPath + 'device.json';
            },
            statusUrl: function() {
                return mockPath + 'data.json';
            },
            rulesUrl: function() {
                return mockPath + 'rules.json';
            },
            remoteStatusUrl: function() {
                return mockPath + 'status.xml';
            }
        });

        return {
            Model: Model,
            model: new Model() //we need to pass a shared model, but we want the base object available for unit testing
        };
    });
